import React from 'react';
import Container from '@material-ui/core/Container';
import Grid from '@material-ui/core/Grid';

const Content = () => {
	return (
		<Container>
			<Grid container direction='row' justify='center' style={{ padding: '20px 0', direction: 'rtl' }}>
				<Grid item xs={4} className='border'>
					<h3>به تیزتایپ خوش آمدید</h3>
					<p style={{ maxWidth: '300px', textAlign: 'justify' }}>
						تیزتایپ بستری مناسب و کارآمد برای سفارش و انجام پروژه‌های تایپ بصورت آنلاین می‌باشد.
					</p>
					<p style={{ maxWidth: '300px', textAlign: 'justify' }}>
						مقدم شمردن حقوق و مزایای کارفرماها و تایپیست‌ها اولین اولویت تیزتایپ است.
					</p>
				</Grid>
				<Grid item xs={4}>
					some2
				</Grid>
				<Grid item xs={4} className='border'>
					some3
				</Grid>
			</Grid>
		</Container>
	);
};

export default Content;
